    __index = function(t, k) 
        local key_map = t._raw_key_map
        assert(key_map[k], "cannot find " .. k .. " in shop_fix_ja")
        if _lang ~= "cn" and _isDataExist  and t._data_key_map[k] then
            return t._data[t._data_key_map[k]]
        end
        if _lang ~= "cn" and _isExist  and t._lang_key_map[k] then
            return t._lang[t._lang_key_map[k]]
        end
        return t._raw[key_map[k]]
    end
}

-- 
function shop_fix_ja.length()
    return #shop_fix_ja._data
end

-- 
function shop_fix_ja.hasKey(k)
    if __key_map[k] == nil then
        return false
    else
        return true
    end
end

--
function shop_fix_ja.isVersionValid(v)
    if shop_fix_ja.version then
        if v then
            return shop_fix_ja.version <= v
        else
            return false
        end
    else
        return true
    end
end

